import { useDispatch } from 'react-redux';

// const dispatch = useDispatch();

const string = 'string';

const Workflow = (props) => {
	return <div>Workflow {props.id}</div>;
};

export async function getStaticProps({ params }) {
	return {
		id: params.id
	};
}

export async function getStaticPaths() {
	// const workflowIds = localStorage.getItem('workflowIds');
	// const jwt = localStorage.getItem('jwt');
	const jwt =
		'eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9.eyJ0b2tlbl90eXBlIjoiYWNjZXNzIiwiZXhwIjoxNTkxOTM4MTIzLCJqdGkiOiJkYTUzYTc5MWJjZjc0Y2NjYThiN2Q3NjAzMWVlODYyMSIsInVzZXJfaWQiOjQ1fQ.PKQLu5rL1IHRsq20rpDLZkM9pzrBW0oiHik1qjedrCk';
	console.log(string);
	const workflowIdsResponse = await fetch('http://localhost:8000/get-workflow-ids', {
		headers: {
			'Content-Type': 'application/json',
			Authorization: `Bearer ${jwt}`
		}
	});
	const workflowIdsJson = await workflowIdsResponse.json();
	const workflowIdsArray = await workflowIdsJson['workflow-ids'];
	const paths = workflowIdsArray.map((workflowId) => {
		return {
			params: {
				id: workflowId
			}
		};
	});
	return {
		paths,
		fallback: false
	};
	// return {
